function generateDataCollection() {
  const collectionOfData = new Array(10);
  const url = 'https://dog.ceo/api/breeds/image/random';

  Promise.all(
    collectionOfData.map(singleData => {
      const newData = {};
      fetch(url)
        .then(res => res.json())
        .then(data => {
          newData.id = collectionOfData.indexOf(singleData);
          newData.name = `Doggie ${newData.id}`;
          newData.imageUrl = data.message;
          newData.price = Math.floor(Math.random() * 10) + 1;
        });
      console.log(newData);
      return newData;
    }),
  );
  console.log(collectionOfData);
  return collectionOfData;
}

export default generateDataCollection;
